import React from "react";

const Box: React.FC = () => {
  return (
    <>
      <div className="content">
        <div className="box shadow-lg">
          <header>
            <h4>Hello Todo List</h4>
          </header>
          <section>
            <div className="add-todolist">
              <input type="text" className="form-control" />
              <button className="btn btn-success">Add</button>
            </div>
          </section>
        </div>
      </div>
    </>
  );
};

export default Box;
